import React from 'react';
import { Box } from '../components/Box';
import { Text } from '../components/Text';

function Home() {
  return (
    <Box>
      <Box
        css={{
          padding: '$5 $6',
          display: 'grid',
          gap: '$3',
          gridTemplateColumns: 'repeat(3, 60px)',
          gridAutoRows: '60px',
          alignItems: 'center',
        }}
      >
        <Text>Aa</Text>
        <Text>Bb</Text>
        <Text>Cc</Text>
        <Text size="1">Aa</Text>
        <Text size="1">Bb</Text>
        <Text size="1">Cc</Text>
      </Box>
      <Box
        css={{
          padding: '$5 $6',
          display: 'flex',
          flexDirection: 'column',
          gap: '$3',
        }}
      >
        <Text size="5" weight="regular">
          No need to worry 'bout tomorrow, and yesterday is gone
        </Text>
        <Text size="5" weight="medium">
          No need to worry 'bout tomorrow, and yesterday is gone
        </Text>
        <Text size="5" weight="semibold">
          No need to worry 'bout tomorrow, and yesterday is gone
        </Text>
        <Text size="5" weight="bold">
          No need to worry 'bout tomorrow, and yesterday is gone
        </Text>
      </Box>
    </Box>
  );
}

export default Home;
